import React from "react";

import "./Profile.css";

import fotoPerfil from "../../images/FotoPerfil/fotoPerfil.png";
// import CodeLanguajes from "../CodeLanguajes/CodeLanguajes";

const Profile = () => {
  return (
    <div className="Profile container">
      <h3 className="text-center">Sobre mí</h3>
      <div className="row">
        <div className="col-3">
          <img
            className="img-fluid rounded"
            alt="Imagen de prueba"
            src={fotoPerfil}
          />
        </div>

        <p className="text-justify">
          Full Stack Developer en &lt;<code>construción</code>
          &gt;, diplomado en trabajo social, apasionado de las nuevas
          tecnologías y de las ciencias sociales.
        </p>
        <p className="text-justify">
          Hace un año decidi hacer una cambio laboral que en su momento parecia
          un giro de 180º, pasar de ser trabajador social a web developer. Y
          solo lo parecia porque no pueden existir mas similitudes entre estas
          dos profesiones.... Trabajas con personas y para personas, la escucha,
          asertividad, habilidades sociales y el trabajo en equipo es son
          fundamentales.
        </p>
      </div>
    </div>
  );
};

export default Profile;
